import React from 'react';
import './App.css';
import DisplayResult from './components/DisplayResult';
import SearchContainer from './components/SearchContainer'
import { useTypedSelector } from './hooks/useTypedSelector';


function App() {
  const {isLoading, images} = useTypedSelector(state => state.images)

  return (
    <div className="App">
      <div
        style={{ height: isLoading || images.length > 0 ? "119px" : "340px" }}
        className="container"
      >
        <SearchContainer />
      </div>
      {isLoading ? 
        <div className='Loader'>
            <div class="loader-bar"></div>
            <div class="loader-bar"></div>
            <div class="loader-bar"></div>
            <div class="loader-bar"></div>
            <div class="loader-bar"></div>
            <div class="loader-bar"></div>
            <div class="loader-bar"></div>
            <div class="loader-bar"></div>
        </div> : <DisplayResult />}
      {/* <DisplayResult /> */}
    </div>
  );
}

export default App;
